import React, { useEffect, useState } from 'react';
import axios from 'axios';

const Leaderboard = () => {
    const [teams, setTeams] = useState([]);

    useEffect(() => {
        axios.get('http://localhost:5002/leaderboard')
            .then(response => {
                setTeams(response.data);
            })
            .catch(error => {
                console.error(error);
            });
    }, []);

    return (
        <table>
            <thead>
                <tr>
                    <th>Team Name</th>
                    <th>Timing</th>
                    <th>Missing Laps</th>
                </tr>
            </thead>
            <tbody>
                {teams.map((team) => (
                    <tr key={team.id}>
                        <td>{team.team_name}</td>
                        <td>{team.timing}</td>
                        <td>{team.missing_laps}</td>
                    </tr>
                ))}
            </tbody>
        </table>
    );
};

export default Leaderboard;
